      <p><img src="img/person.png" width="170px" height="293px"></p>
      <h2>Ceramic Coating</h2>
      <p>Ceramic Coatings are the latest generation of paint sealants for your car. Ceramic Coatings offer by far the most protection, increasing both the hardness and self cleaning ability of paint.</p>
      <p>Ceramic Coatings do however require a little more preparation, and can be harder to apply than a traditional car wax or paintwork sealant.</p>
      <hr>
      <div class="grid grid--fluid grid--2 grid--meshed">
        <div class="grid__item">
          <h4>Uncoated</h4>
          <p><img src="img/ceramic-00.png"></p>
          <p>Dirt and pollutants can sit in paint pores.</p>
        </div>

        <div class="grid__item">
          <h4>Coated</h4>
          <p><img src="img/ceramic-01.png"></p>
          <p>Dirt and pollutants cannot attack paint.</p>
        </div>
    </div>
